import React from 'react';

const EmployeeItem = props => {
  const { name, location, email, login, id, picture } = props;
  return (
    <div>
      <div key={id}>
        <img src={picture.thumbnail} />
        {name.first} {name.last} {email}
      </div>
    </div>
  );
};

export default EmployeeItem;
